// 1. Tutor 
// 2. Laporan 
// 3. Videography 
// 4. Photography 
// 5. Gambar Teknik 
// 6. 3D Desain
import React, { Component } from "react";
import Slider from "react-slick";

export default class Catalogue extends Component {
    render() {
        const settings = {
            className: "center",
            centerMode: true,
            infinite: true,
            centerPadding: "60px",
            slidesToShow: 3,
            speed: 500
        };
        return (
            <div style={{ backgroundColor: "gray" }}>
                <h2>Center Mode</h2>
                <Slider {...settings}>

                </Slider>
            </div>
        );
    }
}
